var isMobile = {
    Android: function () {
        return navigator.userAgent.match(/Android/i);
    },
    BlackBerry: function () {
        return navigator.userAgent.match(/BlackBerry/i);
    },
    iOS: function () {
        return navigator.userAgent.match(/iPhone|iPad|iPod/i);
    },
    Opera: function () {
        return navigator.userAgent.match(/Opera Mini/i);
    },
    Windows: function () {
        return navigator.userAgent.match(/IEMobile/i);
    },
    any: function () {
        return (isMobile.Android() || isMobile.BlackBerry() || isMobile.iOS() || isMobile.Opera() || isMobile.Windows());
    }
};

jQuery(document).ready(function ($) {
    //To fix bug with first tab content at Android
    var ua = navigator.userAgent.toLowerCase();
    var isAndroid = ua.indexOf("android") > -1;
    if (isAndroid) {
        jQuery(".letter-section").hide();
    }

    // Find all jq-tabs classes and activate them
    jQuery(".jq-tabs").each(function () {
        jQuery(this).tabs({heightStyle: "auto"});
    });

    if (isMobile.any()) {
        document.documentElement.className = document.documentElement.className + " touch";

        $('body').addClass('hasTouchScreen');

        $('.has-parallax').each(function () {
            $(this).css("background-position", "center center");
            $(this).css("background-attachment", "scroll");
            $(this).css("background-size", "cover");
        });
    }

});


var lastWindowHeight = jQuery(window).height();
var lastWindowWidth = jQuery(window).width();


jQuery(window).resize(function () {
    //confirm window was actually resized
    if (jQuery(window).height() != lastWindowHeight || jQuery(window).width() != lastWindowWidth) {
        //set this windows size
        lastWindowHeight = jQuery(window).height();
        lastWindowWidth = jQuery(window).width();

    }
});


jQuery(function () {


    $('ul.tabs li, .tabs__item__inner').each(function () {
        var oDuplicateHeader = $(this).find('a').clone();
        var thisID = oDuplicateHeader.attr('href');
        oDuplicateHeader.insertBefore(thisID).addClass('tab-header');
    });

    // hide all widget panels except for the first
    var tabsContainer = $('.tabs-container');
    var tabsLinks = $('ul.tabs a, .tab-header, .tabs__item__inner a');

    tabsContainer.find('.tabs-content:gt(0)').hide();

    $(document).on('click', 'ul.tabs a, a.tab-header, .tabs__item__inner a', function (e) {
        // disable default hyperlink behavior
        e.preventDefault();
        // only execute if the clicked tab is inactive
        if (!$(this).hasClass('active')) {
            var linkHref = e.target.getAttribute('href');
            // set all tabs as "inactive"
            tabsLinks.removeClass('active');
            $('a.tab-header').removeClass('active');
            // set the clicked tab as "active"
            $('[href="' + linkHref + '"]').addClass('active');
            // hide all widget panels
            tabsContainer.find('.tabs-content').hide();
            // show the widget panel based on the the tab's "href"
            $(linkHref).show();
        } else {
            if ($(window).width() < 769) {
                var linkHref = e.target.getAttribute('href');
                // set all tabs as "inactive"
                tabsLinks.removeClass('active');
                $('a.tab-header').removeClass('active');
                // remove active class from selected tab
                $('[href="' + linkHref + '"]').remove('active');
                // hide the widget panel based on the the tab's "href"
                $(linkHref).hide();
            }
        }
        // Scroll to top of Tabs Container
        $('html').animate({scrollTop: $(tabsContainer).offset().top}, 400);

    });

    // Keep active tab open on resize
    $(window).on('resize', function () {

        // Find the active tab href
        var activeTab = undefined;
        var activeTab = $('.tabs-container').find('.active').attr('href');

        // If there is an active tab
        if (activeTab != undefined) {
            // Keep active tab content showing
            $(activeTab).show();
        } else {

            if ($(window).width() > 769) {
                // Activate first tab and show first tab content
                $('.tabs__item:first-child a, .tab-header:first-child').addClass('active');
                $('#Widget-0').show();
            } else {
            }
        }
    });

    // Show first tab on load
    $(window).on('load', function () {
        $('#Widget-0').show();
    });


    window.fbAsyncInit = function () {
        FB.init({
            appId: '1051893084968420',
            autoLogAppEvents: true,
            xfbml: true,
            version: 'v2.12'
        });
    };

    (function (d, s, id) {
        var js, fjs = d.getElementsByTagName(s)[0];
        if (d.getElementById(id)) {
            return;
        }
        js = d.createElement(s);
        js.id = id;
        js.src = "https://connect.facebook.net/en_US/sdk.js";
        fjs.parentNode.insertBefore(js, fjs);
    }(document, 'script', 'facebook-jssdk'));

    $('.share--sys').on('click', function () {
        FB.ui({
            method: 'share',
            display: 'popup',
            quote: fbShareQuote,
            href: fbShareURL,
        }, function (response) {
        });
    });

    jQuery('ul.targets li').each(function () {
        oHiddenField = jQuery(this)
            .find('[type="hidden"]');
        jQuery(this).append(oHiddenField);
    });

    $pic_back_to_top_button = jQuery('.pic-back-to-top__button');

    if ($pic_back_to_top_button.length > 0) {
        $pic_back_to_top_button.click(function (e) {
            e.preventDefault();

            $("html, body").animate({scrollTop: $(".ddc_takeaction__module").offset().top - $('header').height()}, 500);
            return true;
        });

        window.onscroll = function (e) {
            if (window.scrollY > 400) {
                jQuery('.pic-back-to-top').addClass('pic-back-to-top--visible');
            } else {
                jQuery('.pic-back-to-top').removeClass('pic-back-to-top--visible');
            }
        };
    }

    $('.pic-banner__cta').click(function (e) {
        e.preventDefault();
        var $target = $(this).closest('section').next();
        $("html, body").animate({scrollTop: $target.offset().top}, 500);
    });

    $('.pic-sticky-nav__nav-item-link, .pic-two-column-icons__content a, .pic-timeline__content a').click(function (e) {
        var $href = $(this).attr('href');
        var $isPageLink = $href.indexOf("#") > -1;
        if ($isPageLink) {
            e.preventDefault();
            $("html, body").animate({scrollTop: $($href).offset().top}, 500, 'swing', function(){
                setTimeout(function() {
                    $('.headroom--pinned').removeClass('headroom--pinned').addClass('headroom--unpinned');
                }, 250);

            });
            $('.pic-sticky-nav__nav-wrapper').removeClass('pic-sticky-nav__nav-wrapper--open');
            $('.pic-sticky-nav__mobile-toggle').attr('aria-expanded', false);
        }
    });

    $('.pic-sticky-nav__mobile-toggle').click(function (e) {
        e.preventDefault();
        $('.pic-sticky-nav__nav-wrapper').toggleClass('pic-sticky-nav__nav-wrapper--open');
        if ($(this).attr('aria-expanded') === 'true') {
            $(this).attr('aria-expanded', false);
        } else {
            $(this).attr('aria-expanded', true);
        }
    });

    var $sticky_nav = $('.pic-sticky-nav'),
        $footer = $('.footer');

    if ($sticky_nav.length > 0) {
        window.onscroll = function (e) {
            var $footer_offset = $footer.offset().top - $footer.height() - $(window).height();

            if (window.scrollY > $footer_offset) {
                $sticky_nav.addClass('pic-sticky-nav--hidden');
                $('#willow-statement-fixed').addClass('willow-statement-fixed--hidden');
            } else {
                $sticky_nav.removeClass('pic-sticky-nav--hidden');
                $('#willow-statement-fixed').removeClass('willow-statement-fixed--hidden');
            }
        };
    }
});

