jQuery(document).ready(function ($) {
    // When the proxy user login form is submitted, do some verifications and then log-in the user
    $('#proxy-user-form').submit(function (e) {
        e.preventDefault();

        // Setup some variables for performance so we don't reference the same thing multiple times
        var $email_or_id = $('#pa-proxy-user-email-or-id').val(),
            $login_button = $('#pa-proxy-user-login-button'),
            $this = $(this);

        // Delete any alerts in case there was an error and the user re-submits the form
        $this.find('.alert').remove();

        if ($email_or_id === '') {
            return;
        }

        // Loading state for the submit button
        $login_button.append('<span class="spinner-border spinner-border-sm" role="status" aria-hidden="true"></span>').attr('disabled', true);

        // Log-in the user via ajax and handle the responses
        jQuery.ajax({
            type: 'POST',
            url: window['pa'].ajax_url,
            dataType: 'json',
            data: {
                action: 'pa_login_as_proxy_user_via_ajax',
                email_or_id: $email_or_id,
                nonce: $('#pa-proxy-user-nonce').val(),
            },
            success: function (data) {
                // Refresh the current page if it was successful so the page can be viewed as the new user
                window.location.reload();
            },
            error: function (data) {
                // On error reset the button so we can submit the form and output an error message for the user
                $login_button.attr('disabled', false).find('span').remove();
                $this.prepend('<div class="alert alert-danger" role="alert"><p>' + data.responseJSON.message + '</p></div>');
            }
        });
    });

    $('#pa-proxy-user-logout-button').click(function (e) {
        e.preventDefault();

        // Setup some variables for performance so we don't reference the same thing multiple times
        var $logout_button = $('#pa-proxy-user-logout-button'),
            $this = $(this);

        // Delete any alerts in case there was an error and the user re-submits the form
        $this.find('.alert').remove();

        // Loading state for the submit button
        $logout_button.append('<span class="spinner-border spinner-border-sm" role="status" aria-hidden="true"></span>').attr('disabled', true);

        // Send request to logout the user
        jQuery.ajax({
            type: 'POST',
            url: window['pa'].ajax_url,
            dataType: 'json',
            data: {
                action: 'pa_logout_as_proxy_user_via_ajax',
            },
            success: function (data) {
                // On success refresh the current page so the user can see the page normally again
                window.location.reload();
            },
            error: function (data) {
                // On error reset the button so we can submit the form and output an error message for the user
                $this.prepend('<div class="alert alert-danger" role="alert"><p>' + data.responseJSON.message + '</p></div>');
                $logout_button.attr('disabled', false).find('span').remove();
            }
        });

    });

    /*
     * The method we use to add a link to the WordPress admin bar doesn't allow us to add custom attributes such as
     * data-target, which is what Bootstrap uses to open modals. To add a menu item to the WordPress admin bar we can only
     * use <a> tags and we can add custom wrapper classes to it. So we target the <a> to trigger the bootstrap modal to
     * open when it's clicked.
    */
    $('.pa-proxy-user__admin-bar-link a').click(function (e) {
        e.preventDefault();
        $('#pa-proxy-user-modal').modal('show');
    });
});
// we use this to assign the currently submitted form so we don't lose our place during the captcha challenge.
let $pa_contact_form = '';

function pa_validate_email_field($value) {
    var $regex = /^[A-Za-z0-9!#$%&'*+\/=?^_ `{|}~-]+(?:\.[A-Za-z0-9!#$%&'*+\/=?^_`{|}~-]+)*@(?:[A-Za-z0-9](?:[A-Za-z0-9-]*[A-Za-z0-9])?\.)+(?:[A-Z]{2,4}|aero|asia|biz|cat|com|coop|edu|gov|info|int|jobs|mil|mobi|museum|name|net|org|pro|tel|travel|ac|ad|ae|af|ag|ai|al|am|an|ao|aq|ar|as|at|au|aw|ax|az|ba|bb|bd|be|bf|bg|bh|bi|bj|bm|bn|bo|br|bs|bt|bv|bw|by|bz|ca|cc|cd|cf|cg|ch|ci|ck|cl|cm|cn|co|cr|cu|cv|cx|cy|cz|de|dj|dk|dm|do|dz|ec|ee|eg|er|es|et|eu|fi|fj|fk|fm|fo|fr|ga|gb|gd|ge|gf|gg|gh|gi|gl|gm|gn|gp|gq|gr|gs|gt|gu|gw|gy|hk|hm|hn|hr|ht|hu|id|ie|il|im|in|io|iq|ir|is|it|je|jm|jo|jp|ke|kg|kh|ki|km|kn|kp|kr|kw|ky|kz|la|lb|lc|li|lk|lr|ls|lt|lu|lv|ly|ma|mc|md|me|mg|mh|mk|ml|mm|mn|mo|mp|mq|mr|ms|mt|mu|mv|mw|mx|my|mz|na|nc|ne|nf|ng|ni|nl|no|np|nr|nu|nz|om|pa|pe|pf|pg|ph|pk|pl|pm|pn|pr|ps|pt|pw|py|qa|re|ro|rs|ru|rw|sa|sb|sc|sd|se|sg|sh|si|sj|sk|sl|sm|sn|so|sr|st|su|sv|sy|sz|tc|td|tf|tg|th|tj|tk|tl|tm|tn|to|tp|tr|tt|tv|tw|tz|ua|ug|uk|us|uy|uz|va|vc|ve|vg|vi|vn|vu|wf|ws|ye|yt|za|zm|zw)$/;

    if ($regex.test($value.trim())) {
        return true;
    } else {
        return false;
    }
}

function pa_validate_postal_code($value){
    var $regex = /(^\d{5}$)|(^\d{5}-\d{4}$)/;

    if ($regex.test($value.trim())) {
        return true;
    } else {
        return false;
    }
}

function pa_validate_phone_number($value){
    var $regex = /^\(?(\d{3})\)?[\s-]?(\d{3})[\s-]?(\d{4})$/i;

    if ($regex.test($value.trim())) {
        return true;
    } else {
        return false;
    }
}

function pa_contact_form_submit(){
    let
        $ = jQuery,
        $this = $pa_contact_form,
        $form_message = $this.find('.PaContactUs__form__message'),
        $required_fields = $this.find('[data-required="true"]'),
        $required_checkbox_fields = $this.find('[data-required-checkbox="true"]'),
        $required_radio_fields = $this.find('[data-required-radio="true"]'),
        $validate_email_fields = $this.find('[data-validate-email-address="true"]'),
        $validate_postal_code_fields = $this.find('[data-validate-postal-code="true"]'),
        $form_contains_errors = false,
        $email_attachment = $this.find('.PaContactUs__form__email-attachment'),
        $form_fields = $this.find('.PaContactUs__form__row--hide-on-success');

    $this.find('.PaContactUs__form__label--error, .PaContactUs__form__legend--error').remove();

    $required_fields.each(function(){
        // make sure someone doesn't submit a required field with just spaces
        if ($(this).val().replace(/\s+/g, '') === ''){
            $(this).removeClass('is-valid').addClass('is-invalid');
            $(this).closest('.PaContactUs__form__input-wrapper').append('<label for="'+$(this).attr('id')+'" class="PaContactUs__form__label PaContactUs__form__label--error">'+$(this).data('validation-message')+'</label>');
            $form_contains_errors = true;
        } else {
            $(this).removeClass('is-invalid').addClass('is-valid');
        }
    });

    $required_checkbox_fields.each(function(){
         if ($(this).find('input[type="checkbox"]:checked').length === 0){
             $(this).removeClass('is-valid').addClass('is-invalid');
             $(this).find('legend').after('<p class="PaContactUs__form__legend--error">'+$(this).data('validation-message')+'</p>');
             $form_contains_errors = true;
         } else {
             $(this).removeClass('is-invalid').addClass('is-valid');
         }
    });

    $validate_email_fields.each(function(){
        if (!pa_validate_email_field($(this).val().replace(/\s+/g, ''))) {
            $(this).removeClass('is-valid').addClass('is-invalid');
            $(this).closest('.PaContactUs__form__input-wrapper').append('<p class="PaContactUs__form__label PaContactUs__form__label--error">Please enter a valid email address</p>');
            $form_contains_errors = true;
        } else {
            $(this).removeClass('is-invalid').addClass('is-valid');
        }
    });

    $validate_postal_code_fields.each(function(){
        if (!pa_validate_postal_code($(this).val().replace(/\s+/g, ''))) {
            $(this).removeClass('is-valid').addClass('is-invalid');
            $(this).closest('.PaContactUs__form__input-wrapper').append('<p class="PaContactUs__form__label PaContactUs__form__label--error">Please enter a valid zip code</p>');
            $form_contains_errors = true;
        } else {
            $(this).removeClass('is-invalid').addClass('is-valid');
        }
    });

    $required_radio_fields.each(function(){
        if ($(this).find('input[type="radio"]:checked').length === 0){
            $(this).removeClass('is-valid').addClass('is-invalid');
            $(this).find('legend').after('<p class="PaContactUs__form__legend--error">'+$(this).data('validation-message')+'</p>');
            $form_contains_errors = true;
        } else {
            $(this).removeClass('is-invalid').addClass('is-valid');
        }
    });

    $form_message.html('');

    // scroll to the first error on the page so the user knows why the submission did not go through
    if ($form_contains_errors){
        let $first_error = $this.find('.PaContactUs__form__label--error, .PaContactUs__form__legend--error').first().closest('.PaContactUs__form__row');
        $("html, body").animate({ scrollTop: $first_error.offset().top - 70 }, 500);
        return false;
    }

    $form_fields.slideUp();
    $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--loading').html('<p>Submitting....</p>');

    // build the payload as a FormData object so that we can pass along a file upload object
    let formData = new FormData();
    formData.append('action', 'pa_contact_us_submit');
    // takes every form input in the <form> tag and sends it to the process function.
    formData.append('form_data', $this.serialize());
    // url to log where the user came from if registering a new advocate
    formData.append('referral_url', window.location.href);

    // add the current page ID so we can validate the block settings
    formData.append('page_id', window['pa'].current_page_id);

    if ($email_attachment.length > 0) {
        const emailAttachmentFile = $email_attachment.prop('files')[0];

        if (emailAttachmentFile !== null && emailAttachmentFile !== undefined) {
          formData.append('attachment', emailAttachmentFile);
        }
    }

    $.ajax({
        type: 'POST',
        dataType: 'json',
        url: pa_localized.ajax_url,
        contentType: false,
        processData: false,
        data: formData,
        success: function (data){

            if (data.status === 200){

                // if a thank you email is enabled, send it here.
                if (data.sendThankYouEmail === true){
                    var contactEmailService = new EmailService();

                    contactEmailService.sendEmailByNameAndAdvocateId(data.thankYouEmailName, data.advocateId,
                        function (onSuccess) {
                            if (data.redirect_url !== '') {
                                window.location.href = data.redirect_url;
                            } else {
                                $form_message.html('<p>' + data.message + '</p>');
                                $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--success').html('<p>' + data.message + '</p>');
                            }
                        },
                        function (onError) {
                            if (data.redirect_url !== '') {
                                window.location.href = data.redirect_url;
                            } else {
                                $form_message.html('<p>' + data.message + '</p>');
                                $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--success').html('<p>' + data.message + '</p>');
                            }
                        }
                    );
                }
                else {
                    if (data.redirect_url !== '' && typeof data.redirect_url !== 'undefined') {
                        window.location.href = data.redirect_url;
                    } else {
                        // hide everything but the success message to make the page cleaner.
                        $form_message.html('<p>' + data.message + '</p>');
                        $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--success').html('<p>' + data.message + '</p>');
                    }
                }
            }
            else {
                // reset the captcha so the user can submit the form again in case the captcha expired or something.
                $form_fields.slideDown();
                $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--error').html('<p>Error processing your request: '+data.message+'</p>');
                grecaptcha.reset();
            }
        },
        error : function (){
            // reset the captcha so the user can submit the form again in case the captcha expired or something.
            $form_fields.slideDown();
            $form_message.attr('class', 'PaContactUs__form__message PaContactUs__form__message--error').html('<p>There was an error processing your request, please try again.</p>');
            grecaptcha.reset();
        }
    });
}

jQuery(document).ready(function($){

    // when them form is submitted, check the captcha to see if they need to be challenged. If they don't, submit the form.
    $('body').on('submit', '.PaContactUs__form', function(e){
        e.preventDefault();
        $pa_contact_form = $(this);
        if ($pa_contact_form.find('.g-recaptcha-response').val() === '') {
            grecaptcha.execute();
        }
        else {
            pa_contact_form_submit();
        }
    });

});
var $body = jQuery('body'),
    $high_contrast_class = 'pa-high-contrast--enabled',
    $high_contrast_local_storage_key = 'pa-high-contrast';

function pa_high_contrast_footer_hydrated(){
    var $toggle = jQuery('.pa-high-contrast-toggle .pa-nav-link');
    if (localStorage.getItem($high_contrast_local_storage_key) === 'enabled') {
        $body.addClass($high_contrast_class);
        $toggle.text('Turn Off High Contrast');
        $toggle.attr('aria-checked', true);
    } else {
        $body.removeClass($high_contrast_class);
    }
}

window.addEventListener('paFooterHydrated', pa_high_contrast_footer_hydrated);

jQuery(document).ready(function ($) {
    $body.on('click', '.pa-high-contrast-toggle .pa-nav-link', function(e){
        e.preventDefault();
        $body.toggleClass($high_contrast_class);
        if ($body.hasClass($high_contrast_class)) {
            localStorage.setItem($high_contrast_local_storage_key, 'enabled');
            $(this).text('Turn Off High Contrast');
            $(this).attr('aria-checked', true);
        } else {
            localStorage.removeItem($high_contrast_local_storage_key);
            $(this).text('High Contrast');
            $(this).attr('aria-checked', false);
        }
        return false;
    });
});